import React, { useContext } from "react";
import { StateContext } from "../App";

const Error = () => {
  const state = useContext(StateContext);
  return (
    <div>
      <h1>에러화면 (Error) </h1>
      <h2>{state.get("error")}</h2>
    </div>
  );
};

export default Error;
